#!/usr/bin/env python
# -*- coding: utf-8 -*-

"""
A message containing letters from A-Z is being encoded to numbers using the following mapping way:

'A' -> 1
'B' -> 2
...
'Z' -> 26
Beyond that, now the encoded string can also contain the character '*', which can be treated as one of the numbers from 1 to 9.

Given the encoded message containing digits and the character '*', return the total number of ways to decode it.

Also, since the answer may be very large, you should return the output mod 109 + 7.

Example 1:
Input: "*"
Output: 9
Explanation: The encoded message can be decoded to the string: "A", "B", "C", "D", "E", "F", "G", "H", "I".
Example 2:
Input: "1*"
Output: 9 + 9 = 18
Note:
The length of the input string will fit in range [1, 105].
The input string will only contain the character '*' and digits '0' - '9'.

SOLUTION:
    Typical 1D Dynamic programming problem.
    Basically the choice at a certain index i will be:
        - Choices if considered i to be independent times choices of string made after i
        - Plus choices if considered i and i+1 times choices of string made after i+1

        So, formulation will be:
        A[i] = DECODE(S[i]) * A[i+1] + DECODE(S[i,i+1]) * A[i+2]

        Cost: O(n) time, O(1) space since we only need to store values at the next / previous 2 levels
"""

X_LOOKUP = {'*': 9, '1': 1, '0': 0, '3': 1, '2': 1, '5': 1, '4': 1, '7': 1, '6': 1, '9': 1, '8': 1}
# XY_LOOKUP = {'24': 1, '25': 1, '26': 1, '20': 1, '21': 1, '22': 1, '23': 1, '0*': 0, '2*': 6, '*8': 1, '*9': 1, '*4': 2, '*5': 2, '*6': 2, '*7': 1, '*0': 2, '*1': 2, '*2': 2, '*3': 2, '**': 15, '11': 1, '10': 1, '13': 1, '12': 1, '15': 1, '14': 1, '17': 1, '16': 1, '19': 1, '18': 1, '1*': 9}

def init_xy_lookup():
    lookup = {
        '0*': 0,
        '1*': 9,
        '2*': 6,
        '**': 15, # 26 bar sub 10 and 20
    }
    for i in '0123456789':
        lookup['1' + i] = 1

    for i in '0123456':
        lookup['2' + i] = 1

    for i in '0123456789':
        if int(i) <= 6:
            lookup['*' + i] = 2
        else:
            lookup['*' + i] = 1

    return lookup

XY_LOOKUP = init_xy_lookup() # if not already

def decode_x(x):
    """
    Single digit decoding
    """
    return X_LOOKUP[x]

def decode_xy(xy):
    """
    Double digit decoding
    """
    return XY_LOOKUP.get(xy, 0)


def decode(message):
    K = 10 ** 9 + 7

    n = len(message)

    mem_1 = X_LOOKUP[message[-1]]
    # mem_1 = decode_x(message[-1])
    if n == 1:
        return mem_1

    mem_2 = 1
    for i in range(n - 2, -1, -1):
        mem_i = 0
        if mem_1 > 0:
            mem_i += decode_x(message[i]) * mem_1

        if mem_2 > 0:
            mem_i += decode_xy(message[i:i+2]) * mem_2

        mem_i %= K # this is critical, since adding large numbers is expensive

        mem_1, mem_2 = mem_i, mem_1

    return mem_1

class Solution(object):
    def numDecodings(self, s):
        """
        :type s: str
        :rtype: int
        """
        return decode(s)

